import React from 'react';
import {Nav, NavbarContainer, NavLogo, NavMenu} from './NavbarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
          <NavbarContainer>
            <NavLogo to="/">
                <img src={require('../../images/splendi_logo_convert.svg').default} 
                heigth={150} width={150}/>
            </NavLogo>
          </NavbarContainer>

          </Nav>

    </>
  )
}

export default Navbar;
